import React from 'react'
import './Chat.css'
const Chat = () => {
  return (
    <>
      <div className="Chat">
        {/* Left Side */}
        <div className="Left-side-chat">
            <h2>Chats</h2>
        </div>

         {/* Right Side */}
         <div className="Right-side-chat">
            <h2>Chat</h2>
        </div>

      </div>
    </>
  )
}

export default Chat
